    const [currentComponent, setCurrentComponent] = useState('Header');

    const renderComponent = () => {
      switch (currentComponent) {
        case 'Header':
          return <Header setCurrentComponent={setCurrentComponent} />;
        case 'BookingForm':
          return <BookingForm />;
        default:
          return null;
      }
    };

    return (
      <div>
        <Nav setCurrentComponent={setCurrentComponent} />
        {renderComponent()}
      </div>
    );
  };

  export default App;
